script: |
  super -f text -I q7327.spq | sort > q7327.out

inputs:
  - name: q7327.spq
    data: |
      SELECT col1 * + tab0.col1 - col0 / - col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 IN ( col0 * col0 * col2 + col1 * col2 );
  - name: tab0

outputs:
  - name: q7327.out
    data: |
      7397
      8282
      9410
